import React from 'react'

const link = [
    { id: 0, list: "Course Intro" },
    { id: 1, list: "Outline" },
    { id: 2, list: "Preview" }
  ];
const OutlineCourse = () => {
  return (
    <div>
         <div className='outline-list'>
                {link.map((link) => (
                    <ul>
                        <li key={link.id}>
                            {link.list}
                        </li>
                    </ul>
                ))}
                </div>
                <div className='outline-item'>
                    <h2>Nothing for now</h2>
                </div>
    </div>
  )
}

export default OutlineCourse
